### Summary of Core Topics and Concepts

#### 1. **System Commands and Scripting**
- **Cron Jobs**: Understanding the format and usage of cron jobs to schedule tasks.
  - Format: `* * * * * <Command(s) with argument>`
  - Fields: Minute, Hour, Day of the Month, Month of the Year, Day of the Week
- **Conditional Statements in Scripts**: Using `if` statements to check conditions and execute commands.
  - Example: `if [[ $status -eq 200 ]]; then print "Success"; else print "Something went wrong"; fi`
- **Variable Manipulation**: Using variables and commands like `rev` to manipulate text.
  - Example: `echo "${A}NN${(echo $A | rev)}"`
- **File Links**: Understanding hard links and soft links (symbolic links).
  - Hard links: Multiple directory entries pointing to the same inode.
  - Soft links: A file that points to another file by name.
- **Text Editors**: Basic commands in Vi and Emacs editors.
  - Vi: `j`, `dd`, `dk`, `0`, `dw`
  - Emacs: `<C-e>`, `<C-k>`, `<C-a>`, `<M-d>`, `<C-d>`
- **Pattern Matching**: Using `grep` for pattern matching in files.
  - Example: `grep '\d+$' data.txt`
- **File Operations**: Using commands like `mv`, `cp`, and `stat` to manage files.
  - Example: `stat -c %s "$i"` to get file size.
- **Loops and Patterns**: Using `while` loops and pattern matching in scripts.
  - Example: `while read line; do [[ $line == $pat ]] && break; done`

#### 2. **Command-Line Tools**
- **`echo` and `print`**: Printing text to the terminal.
  - Example: `echo "Welcome to the Summer Camp Pichavaram"`
- **`grep`**: Searching for patterns in files.
  - Example: `grep '^[0-9]+' data.txt`
- **`ls` and `pwd`**: Listing directory contents and printing the current working directory.
  - Example: `ls -li`, `pwd`
- **`date`**: Getting the current date and time.
  - Example: `date +%H:%M`
- **`cat`**: Displaying file contents.
  - Example: `cat file.txt`

#### 3. **File System and Links**
- **Inode**: Understanding inodes and how they relate to files.
  - Example: `ls -li` to list inode numbers.
- **Hard Links and Soft Links**: Understanding the difference and usage.
  - Hard links: Share the same inode.
  - Soft links: Point to another file by name.

